import React, { useState, useEffect } from 'react';
import axios from 'axios';

interface TestsListProps {
  onTestSelect: (test_name: string) => void;
}

const TestsList: React.FC<TestsListProps> = ({ onTestSelect }) => {
  const [testNames, setTestNames] = useState<string[]>([]);

  useEffect(() => {
    const fetchTestNames = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/test-names');
        setTestNames(response.data);
      } catch (error) {
        console.error(error);
      }
    };
    fetchTestNames();
  }, []);

  const handleTestClick = (name: string) => {
    onTestSelect(name);
  };
  return (
    <div>
      <h2>All Test Names</h2>
      {testNames.map((name, index) => (
        <div key={index} onClick={() => handleTestClick(name)}>
          {name}
        </div>
      ))}
    </div>
  );
};

export default TestsList;
